script: |
  super -f text -I q7253.spq | sort > q7253.out

inputs:
  - name: q7253.spq
    data: |
      SELECT ALL + col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 * - col1 + + + col1 BETWEEN + col1 * col1 * + - CAST ( NULL AS REAL ) - + - 95 / + col1 * + + ( + ( - col1 ) ) + 27 AND ( - 92 * + col2 );
  - name: tab1

outputs:
  - name: q7253.out
    data: |
